  `update_time` datetime DEFAULT NULL,
  `metrics_id` bigint(20) DEFAULT NULL,
  `model_name` varchar(20) COLLATE utf8_bin DEFAULT NULL,
  `team_ids` longtext COLLATE utf8_bin,
  PRIMARY KEY (`id`,`logic`)
) ENGINE=InnoDB AUTO_INCREMENT=56 DEFAULT CHARSET=utf8 COLLATE=utf8_bin ROW_FORMAT=DYNAMIC;

